import UseFetch from "../../hooks/UseFetch";
import UserArticles from './UserArticles';


function UserConf({token, id}) {
  console.log(id)
  console.log(token)
  const handleSubmit = async e => {
    e.preventDefault()
    try{
      const res = await fetch(`http://localhost:4000/noticiasusuario/${id}`, {
        method: 'GET',
        headers: {'Content-Type': 'application/json',
        'Authorization': token},     
      })
      const data = await res.json()
        if (res.ok){
          console.log(data)
        } 
    }   
    catch(e){
      console.warn(e)
    }
  }


return (
    <div className="UserNews">
      <button onClick={handleButton}></button>
        <UserArticles data={data}/>
    </div>
)}


export default UserConf;
